import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import * as actions from "../store/actions/index";

class AppHeader extends React.Component {

  showMenu = (e) => {
    e.preventDefault()
    return (
      <div className='product-nav'>
        <div className='product-nav-centered'>
          <div className='dropdown'>
            <ion-icon size='large' name='menu-outline'></ion-icon>
          </div>
        </div>
      </div>
    );
  }

  render() {
    return (
      <nav className='nav-container'>
        <div className='row'>
          <div className='nav-bar'>
            <div className='nav-links'>
              <ul className='main-nav'>
                <li>
                  <Link to='/brands'>
                    <span id='button'>DESIGNERS</span>
                  </Link>
                </li>
                <li>
                  <Link to='/products'>
                    <span id='button'>CLOTHING</span>
                  </Link>
                </li>
                <li>
                  <Link to='/accessories'>
                    <span id='button'>ACCESSORIES</span>
                  </Link>
                </li>
                <li>
                  <Link to='/plans'>
                    <span id='button'>PLANS</span>
                  </Link>
                </li>
              </ul>
              <ul className='user-menu'>
                <span>
                  <ion-icon onClick={(e) => this.showMenu(e)} size='large' name='menu-outline'></ion-icon>
                  {this.props.token !== null ? (
                    <Link to='/favorites'>
                      <ion-icon size='large' name='heart-outline'></ion-icon>
                    </Link>
                  ) : (
                    <Link to='/login'>
                      <ion-icon size='large' name='heart-outline'></ion-icon>
                    </Link>
                  )}
                </span>
                <span>
                  {this.props.token !== null ? (
                    <Link to='/profile'>
                      <ion-icon size='large' name='person-outline'></ion-icon>
                    </Link>
                  ) : (
                    <Link to='/login'>
                      <ion-icon size='large' name='person-outline'></ion-icon>
                    </Link>
                  )}
                </span>
                <span>
                  {this.props.token !== null ? (
                    <Link to='/cart'>
                      <ion-icon size='large' name='cart-outline'></ion-icon>
                    </Link>
                  ) : (
                    <Link to='/login'>
                      <ion-icon size='large' name='cart-outline'></ion-icon>
                    </Link>
                  )}
                </span>
                <span>
                  {this.props.token !== null ? (
                    <Link to='/login'>
                      <span id='button' onClick={(e) => this.props.logout(e)}>
                      </span>
                    </Link>
                  ) : (
                    <Link to='/login'>
                    </Link>
                  )}
                </span>
              </ul>
            </div>
          </div>
        </div>
      </nav>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    current_user: state.auth.current_user,
    token: state.auth.token,
    favorites: state.favorite.select,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    logout: (e) => dispatch(actions.logout(e)),
    initProducts: () => dispatch(actions.initProducts()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(AppHeader);
